import React from "react";
import Fab from "@material-ui/core/Fab";
class Home extends React.Component {
  render() {
    return (
      <Fab color="secondary" aria-label="Add" className={classes.margin}>
        <AddIcon />
      </Fab>
    );
  }
}
export default Home;
